import './App.css';
import Footer from './Footer/Footer';
import Main from './Main/Main';
import Navbar from './Navbar/Navbar';
import { Routes, Route } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route path="/" component={Main}></Route>
      </Routes>


      <Footer />
    </div>
  );
}

export default App;
